import React from 'react';
import BlogrImg from '../Assets/blogr-mobile.png';
import DashboardImg from '../Assets/dashboard-desktop-view.png';
import DevPortImg from '../Assets/developer-portfolio.png';

class Projects extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="p-5 d-flex flex-row flex-wrap" style={{color:'#EEEEEE', backgroundColor:'#222831'}}>
         <h1 className="block w-100">Projects</h1>
         <p className="block w-100" style={{color:'#00ADB5'}}>Building projects and working with people are ways of honing my skill. I learn from every project</p>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3 my-sm-5" style={{maxWidth: 300, backgroundColor: '#EEEEEE', color:'#03045E'}}>
            <img src={BlogrImg} alt="Project Images" className="rounded-3"/>
            <p>Blogr Landing Page</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3 my-sm-5" style={{maxWidth: 300, backgroundColor: '#EEEEEE', color:'#03045E'}}>
            <img src={DashboardImg} alt="Project Images" className="rounded-3" />
            <p>Time Tracking Dashboard</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3 my-sm-5" style={{maxWidth: 300, backgroundColor: '#EEEEEE', color:'#03045E'}}>
            <img src={DevPortImg} alt="Project Images" className="rounded-3" />
            <p>Coming Soon Page</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3 my-sm-5" style={{maxWidth: 300, backgroundColor: '#EEEEEE', color:'#03045E'}}>
            <img src={DashboardImg} alt="Project Images" className="rounded-3" />
            <p>Dashboard</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3 my-sm-5" style={{maxWidth: 300, backgroundColor: '#EEEEEE', color:'#03045E'}}>
            <img src={DevPortImg} alt="Project Images" className="rounded-3" />
            <p>Developer Portfolio</p>
         </div>
      </div>
    );
  }
}

export { Projects }
